import os
import random
import string
import subprocess
import time
import ctypes

aktueller_pfad = os.path.dirname(os.path.abspath(__file__))

def zufaelliger_string(laenge=8):
    buchstaben = string.ascii_letters + string.digits
    return ''.join(random.choice(buchstaben) for _ in range(laenge))

def erstelle_datei():
    neuer_dateiname = zufaelliger_string(64) + ".txt"  # Langer zuf√§lliger String
    vollstaendiger_pfad = os.path.join(aktueller_pfad, neuer_dateiname)
    with open(vollstaendiger_pfad, 'w') as neue_datei:
        neue_datei.write("")
    print(f"Datei '{neuer_dateiname}' wurde im Pfad '{aktueller_pfad}' erstellt.")

# Fenster minimieren
def fenster_minimieren():
    user32 = ctypes.windll.user32
    h_wnd = user32.GetForegroundWindow()
    user32.ShowWindow(h_wnd, 6)  # 6 = SW_MINIMIZE

fenster_minimieren()  # Fenster minimieren, wenn Skript gestartet wird

while True:  
    erstelle_datei()
